INSERT INTO `v1_721c0e2912fa05228bd75bc9e15d6eb8d9189ef98fa8079a9b04d2f2e86fe700` VALUES (1, 111011, 0, "", 5, "ややっ？　よくよく見ればこの土台、\nケーキなのはほんの一部分だけで、\n大半はよく出来た模造品じゃあないか！\nな、なんと配慮の行き届いた……！", 11, 1110501, 1110501049, 0, 1);
